/* eslint-disable jsx-a11y/anchor-is-valid */
export const Navigation = () => {
  document.querySelector(".nav-btn").addEventListener("click", function () {
    const menu = document.querySelector(".navigation-slider");
    const navIcon = document.querySelector(".nav-btn");
    const invis = document.querySelector(".invisible");
    const marginProp = window
      .getComputedStyle(menu)
      .getPropertyValue("margin-left");

    if (marginProp === "-300px") {
      menu.style.marginLeft = "0px";
      navIcon.style.position = "fixed";
      invis.style.position = "relative";
    } else if (marginProp === "0px") {
      menu.style.marginLeft = "-300px";
      navIcon.style.removeProperty("position");
      invis.style.position = "absolute";
    }
  });

  document.querySelector("main").addEventListener("click", function () {
    const menu = document.querySelector(".navigation-slider");
    const navIcon = document.querySelector(".nav-btn");
    const invis = document.querySelector(".invisible");
    const marginProp = window
      .getComputedStyle(menu)
      .getPropertyValue("margin-left");

    if (marginProp === "0px") {
      menu.style.marginLeft = "-300px";
      navIcon.style.removeProperty("position");
      invis.style.position = "absolute";
    }
  });

  return (
    <>
      <section class="navigation-slider">
        <section class="sign-in">
          <img
            class="profile-icon"
            src="/Images/Icons/profile-icon.png"
            alt="Sign in"
          />
          <a class="sign-in__link">Sign in</a>
        </section>
        <ul class="navigation-options">
          <li class="option">
            <a href="/home.html">
              <p>Home</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li class="option">
            <a href="/products.html">
              <p>Cameras</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li class="option">
            <a href="/products.html">
              <p>Lens</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li class="option">
            <a href="/products.html">
              <p>Accessories</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li class="option">
            <a href="/products.html">
              <p>Carrying Bags</p>
              <p>&#10095;</p>
            </a>
          </li>

          <li class="option">
            <a href="/products.html">
              <p>Tripods</p>
              <p>&#10095;</p>
            </a>
          </li>
          <li class="option">
            <a href="/products.html">
              <p>Sale</p>
              <p>&#10095;</p>
            </a>
          </li>
        </ul>
        <ul class="help-options">
          <li class="option">
            <a href="/contact.html">
              <p>Contact Us</p>
            </a>
          </li>
          <li class="option">
            <a href="/contact.html">
              <p>Newsletter</p>
            </a>
          </li>
          <li class="option">
            <a href="/contact.html">
              <p>Find a store</p>
            </a>
          </li>
          <li class="option">
            <a href="/contact.html">
              <p>Legal & Privacy</p>
            </a>
          </li>
        </ul>
      </section>
    </>
  );
};
